import React, {useState,Component } from 'react';
import '../../App.css';
import Axios from 'axios';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import {Form,Col, Button} from 'react-bootstrap';
import {Container, Typography} from "@material-ui/core";
import logo from '../../assets/image/logo.png';
import DoctorNavigation from '../../components/DoctorNavigation';
import { render } from '@testing-library/react';
 
const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    marginLeft:200,
    marginBottom:100
  },
  details: {
    display: 'flex',
    flexDirection: 'column',
  },
  content: {
    flex: '1 0 auto',
  },
  cover: {
    width: 400,
  },
  controls: {
    display: 'flex',
    alignItems: 'center',
    paddingLeft: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
  playIcon: {
    height: 38,
    width: 38,
  },
}));

 
  export default class Patient extends Component{ 
  
  

  // const [v_id,setV_id]=useState("");
  // const [patient_id,setPatient_id]=useState("");
  // const [vc_id,setVC_id]=useState("");
  // const [vaccine_id,setVaccine_id]=useState("");
  // const [doctor_id,setDoctor_id]=useState("");
  // const [time,setTime]=useState("");
  // const [date,setDate]=useState("");
  // const [result,setResult]=useState("");
  // const [reason,setReason]=useState("");
  
  constructor(props){
    super(props)

    this.onChangeV_id = this.onChangeV_id.bind(this);
    this.onChangePatient_id = this.onChangePatient_id.bind(this);
    this.onChangeVc_id = this.onChangeVc_id.bind(this);
    this.onChangeVaccine_id =  this.onChangeVaccine_id.bind(this);
    this.onChangeDoctor_id = this.onChangeDoctor_id.bind(this);
    this.onChangeTime = this.onChangeTime.bind(this);
    this.onChangeDate =  this.onChangeDate.bind(this);
    this.onChangeResult = this.onChangeResult.bind(this);
    this.onChangeReason = this.onChangeReason.bind(this);
    this.onSubmit = this.onSubmit.bind(this);

    this.state = {
       v_id: '',
       patient: '' ,
        vc_id: '', 
        vaccine_id:'', 
        doctor_id:'' , 
        time:'',
        date:'',
        result:'',
        reason:''
    }

   this.onChangeV_id(e); {
   this.setState({ v_id: e.target.value })
}

this.onChangePatient_id(e);{
  this.setState({ patient_id: e.target.value })
}
this.onChangeVc_id(e); {
  this.setState({ Vc_id: e.target.value })
}

this.onChangeVaccine_id(e); {
  this.setState({ vaccine_id: e.target.value })
}

this.onChangeDoctor_id(e); {
  this.setState({ doctor_id: e.target.value })
}

this.onChangeTime(e); {
  this.setState({ time: e.target.value })
}
this.onChangeDate(e); {
  this.setState({ date: e.target.value })
}

this.onChangeResult(e); {
  this.setState({ result: e.target.value })
}
this.onChangeReason(e); {
  this.setState({ reason: e.target.value })
}
onSubmit(e); {
  e.preventDefault()

  const userObject = {
      v_id: this.state.v_id,
      patient_id: this.state.patient_id,
      doctor_id: this.state.doctor_id,
      vc_id: this.state.vc_id,
      vaccine_id: this.state.vaccine_id,
      time: this.state.time,
      date: this.state.date,
      result: this.state.result,
      reason: this.state.reason

  };

// function saveData()

Axios.post("http://localhost:3001/vaccination",userObject)
//   v_id:v_id,
//   patient_id:patient_id,
//   vc_id: vc_id,
//   vaccine_id: vaccine_id,
//   doctor_id: doctor_id,
//   time: time,
//   date: date,
//   result: result,
//  reason: reason,
.then(()=>{
  alert("successful insert");
}).catch((err)=>{
  console.log('data not sent')
})
this.setState({ v_id: '', patient: '' , vc_id: '', vaccine_id:'', doctor_id:'' , time:'',date:'',result:'',reason:'' })
};

render (); {
  return (
    <Container>
      <DoctorNavigation />
      <div className="VCLabel"  >
        <img src={logo} alt=" " style={{height:100,width:100, marginLeft:130}} />
 <Typography style={{fontFamily:"Carter One",color:"#fff",fontSize:50,marginLeft:70}} >
        Patient
      </Typography>
      </div>
    <Card className="registration">
    <CardMedia
        className={classes.cover}
        // image="https://images.pexels.com/photos/5412/water-blue-ocean.jpg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"
        // title="Live from space album cover"
        style={{backgroundColor:"#41649c"}}
      />
      
      <div className={classes.details}>
        <CardContent className={classes.content}>
          <Typography style={{fontSize:30, marginBottom:20,fontFamily: "Carter One", color: "#41649c"}}>
            Registration Form
          </Typography>
        <Form>
          <Form.Row>
          <Form.Group as={Col}>
      <Form.Label className="v_id"  >Vaccination_id</Form.Label>
      <Form.Control type="text" value={this.state.v_id} onChange={this.onChangeV_id} placeholder="Enter vaccination-id" />
    </Form.Group>
          </Form.Row>
        <Form.Row>
    <Form.Group as={Col} >
      <Form.Label className="patient_id">Patient-id</Form.Label>
      <Form.Control type="text" value={this.state.patient_id} onChange={this.onChangePatient_id} placeholder="Enter Patient-id" />
    </Form.Group>
    <Form.Group as={Col} >
      <Form.Label className="doctor_id" >Doctor-id</Form.Label>
      <Form.Control type="text" value={this.state.doctor_id} onChange={this.onChangeDoctor_id} placeholder="Enter doctor-id" />
    </Form.Group>
</Form.Row>
  <Form.Row>
    <Form.Group as={Col} >
      <Form.Label className="VC_id"  >Vaccination Center ID</Form.Label>
      <Form.Control type="text" value={this.state.vc_id} onChange={this.onChangeVc_id} placeholder="Enter Vaccination Center Id" />
    </Form.Group>
    <Form.Group as={Col} >
      <Form.Label className="vaccine_id" >Vaccine-id</Form.Label>
      <Form.Control type="text"value={this.state.vaccine} onChange={this.onChangeVaccine_id} placeholder="Enter vaccine ID" />
    </Form.Group>
</Form.Row>
<Form.Row>
  <Form.Group >
      <Form.Label className="date" >Vaccination Date</Form.Label>
      <Form.Control type="text" value={this.state.date} onChange={this.onChangeDate} placeholder="Enter Vaccination Date" />
    </Form.Group>
    <Form.Group >
      <Form.Label className="time" >Vaccination Time</Form.Label>
      <Form.Control type="text" value={this.state.time} onChange={this.onChangeTime} placeholder="Enter Vaccination Date" />
    </Form.Group>
  </Form.Row>
  <Form.Row>
    <Form.Group as={Col} >
      <Form.Label className="result" >Vaccination Result</Form.Label>
      <Form.Control type="text" value={this.state.result} onChange={this.onChangeResult} placeholder="i-e Verify/Not Verify" />
    </Form.Group>
    <Form.Group as={Col} >
      <Form.Label className="reason" >Vaccination Purpose</Form.Label>
      <Form.Control type="text" value={this.state.reason} onChange={this.onChangeReason}  />
    </Form.Group>
  </Form.Row>

  <Button variant="primary" onSubmit={this.onSubmit}  type="submit">
    Register
  </Button>
</Form>
         
        </CardContent>
        
      </div>
    
    </Card>
    </Container>
  );
}
  }
}
